SPORTING INTELLIGENCE.

WOLVERHAMPTON MEETING.

TUESDAY.—Enville Plate.—Plenipotentiary, 9 yrs, 6st 12lb (1); Ziesca, aged, 7st 10lb (2); Remus, 8 yrs, 7st 4lb (3). Patshull Stakes.—Sportsman, 6 yrs, 7st 2lb (1); The Boy, 2 yrs, 6st 12lb (2); Fancy Boy, 2 yrs, 6st 12lb (3). Staffordshire Nursery Handicap.—Princess, 6st 12lb (1);
